 set , for which SIMCA was most predictive . RP gave the least predictive models for all but the MAO set . A similar trend was observed when using training and test sets to which compounds were randomly assigned and when gradually eliminating compounds from the ( designed ) training set . The stability of models was examined for the random and reduced sets , where stability means that classification statistics and the selected descriptors are similar for models derived from different sets . Here , SIMCA produced the most stable models , followed by SFGA and RP . We show that a consensus approach that combines all three methods outperforms the single best model for all data sets .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Integrative analysis of transcriptomics , proteomics , and metabolomics data of white adipose and liver tissue of high-fat diet and rosiglitazone-treated insulin-resistant mice identified pathway alterations and molecular hubs . The incidences of obesity and type 2 diabetes are rapidly increasing and have evolved into a global epidemic . In this study , we analyzed the molecular effects of high-fat diet ( HFD ) - induced insulin-resistance on mice in two metabolic target tissues , the white adipose tissue ( WAT ) and the liver . Additionally , we analyzed the effects of drug treatment using the specific PPAR ligand rosiglitazone . We integrated transcriptome , proteome , and metabolome data sets for a combined holistic view of molecular mechanisms in type 2 diabetes . Using network and pathway analyses , we identified hub proteins such as

 and

</mark>
 in WAT and deregulation of major metabolic pathways in the insulin-resistant state , including the TCA cycle , oxidative phosphorylation , and branched chain amino acid metabolism . Rosiglitazone treatment resulted mainly in modulation via 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">6</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Neuroinflammation in Alzheimer ' s disease : chemokines produced by astrocytes and chemokine receptors . Chemokines secreted by astrocytes play multiple roles in the pathology of Alzheimer ' s disease , a chronic inflammation disorder of central nervous system . The level of chemokines in serum , cerebrospinal fluid and brain tissue and their receptors both significantly changed in patients with Alzheimer ' s disease . In this review , we briefly summarized the involvement of astrocytes and chemokines in Alzheimer ' s disease , and the role of chemokine / chemokine receptors in the occurrence and development of Alzheimer ' s disease . Clarification of the involvement of chemokines and their receptors , such as

 supplemented with an NADPH-generating system .

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">New data integrating multitargeted antifolates into treatment of first-line and relapsed non-small-cell lung cancer . Non-small-cell lung cancer ( NSCLC ) represents approximately 80 % of all lung cancers . With modern platinum - based combination regimens , overall median survival has reached 9-12 months . Antifolates are active against several solid tumors and hematologic malignancies . The cytotoxic action of antifolates is mainly related to their ability to inhibit several different folate-dependent enzymes involved in DNA synthesis . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00642
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is a novel multitargeted antifolate that inhibits at least 3 of the enzymes involved in purine and pyrimidine synthesis : thymidylate synthase ( TS ) , dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , and glycinamide ribonucleotide formyltransferase ( GARFT ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00642
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 was approved for the treatment of relapsed NSCLC as it produced equivalent response and survival rates and less toxicity compared with docetaxel . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00642
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 in combination with platinum analogues or with gemcitabine showed equivalent clinical impact compared with standard combinations of platinum plus third-generation agents . We analyze the potential implications of pemetrexed ' s role in first-line chemotherapy of NSCLC as well as hints of differential cytotoxic action according to histology , new schedules of vitamin supplementation , and target enzymes expression levels . Issues of pharmacogenomics are becoming relevant in defining pemetrexed efficacy . Chemosensitivity was significantly linked to low levels of TS , GARFT , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in preclinical models . Consequently , the differential expression of TS according to histology might explain the different activity of pemetrexed according to histology , as recently postulated .</div>

<h2 style="margin: 0">11</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Development of stable cell lines expressing different subtypes of GABAA receptors . The experiments reported here were motivated by our interest to express in stably-transfected cells large amounts of recombinant rat GABAA receptors . For this , we developed an original two step selection strategy , in which the first step consisted of transfecting 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 293 cells with rat GABAA receptor alpha and beta subunits . G 418 resistant colonies isolated at this step were screened for [ 3H ] muscimol binding to select for those that coexpressed alpha - and beta-subunits . The best alpha and beta subunit expressing colony was then supertransfected with a plasmid coding for the gamma rat GABAA receptor subunit and a mutant 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 gene . After a second round of selection , this time in presence of methotrexate , those colonies that coexpressed ternary alpha beta gamma GABAA receptor combinations were distinguished using [ 3H ] flumazenil as a probe . This strategy was applied to the isolation of 3 GABAA receptor clones , alpha 1 beta 2 gamma 2s , alpha 3 beta 2 gamma 2s and alpha 5 beta 3 gamma 2s , that expressed relatively high levels of these proteins . These 3 cell lines exhibited pharmacological and functional properties similar to cells transiently-transfected with equivalent subunit combinations . These cell lines therefore provide attractive models with which to evaluate the intrinsic activity and potency of compounds at recombinant GABAA receptor subtypes .</div>

 in an internal ribosomal entry site ( IRES ) - containing bicistronic vector ( HaMID ) . Cells were then expanded for 15 days in cultures stimulated with interleukin ( IL ) - 3 ,

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">DB00945 antagonizes the cytotoxic effect of methotrexate in lung cancer cells . DB00563 ( MTX ) has been widely used for the treatment of cancer and rheumatoid arthritis ( RA ) . DB00945 ( ASA ) is a non-selective cyclooxygenase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P36551
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) inhibitor that contributes to the treatment of inflammatory conditions such as RA . It has been observed that the antitumor effect of ASA can be attributed to inhibition of cell cycle progression , induction of apoptosis and inhibition of angiogenesis . In the present study , we revealed that the treatment with a combination of MTX and ASA resulted in antagonism of the cytotoxic effect as demonstrated by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P50991
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and colony formation assays . ASA alleviated the MTX-mediated S phase accumulation and recovered the P55008 phase . MTX-mediated accumulation of the S phase marker cyclin A was also alleviated by ASA . Notably , FAS protein levels were upregulated by MTX in A549 cells . The antagonism of MTX efficacy caused by ASA was accompanied by altered expression of caspase - 3 , Bcl - 2 and FAS but not dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . This suggests that the alteration of caspase - 3 , Bcl - 2 and FAS was involved in the antagonism between ASA and MTX . Exogenously added folic acid reversed the MTX-mediated 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibition following either MTX or MTX + ASA treatments . Most importantly , we demonstrated for the first time that the commonly used non-steroidal anti-inflammatory drug for headache ASA and possibly other 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P23219
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 / 2 inhibitors can produce a strong antagonistic effect on the growth inhibition of lung cancer cells when administered in combination with MTX . The clinical implication of our finding is obvious , i . e . , the clinical efficacy of MTX therapy can be compromised by ASA and their concomitant use should be avoided .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Cbl-b is a negative regulator of inflammatory cytokines produced by IgE-activated mast cells . c-Cbl and Cbl-b E3 ubiquitin ligases are abundantly expressed in hemopoietic cells where they negatively regulate the activity and levels of many cell surface receptors and associated signaling molecules . By comparing bone marrow-derived mast cells from c-Cbl and Cbl-b-deficient mice it has recently been shown that Cbl-b is the dominant family member for negatively regulating signaling responses from high-affinity IgE receptors . In this study , we suggest that a possible reason for the greater enhancement of IgE receptor signaling in Cbl-b-deficient mice is the relatively higher levels of Cbl-b protein over c-Cbl in mast cells compared with other hemopoietic cells . We also directly compare mast cells from c-Cbl and Cbl-b-deficient mice and find that loss of Cbl-b , but not c-Cbl , increases cell growth , retards receptor internalization , and causes the sustained tyrosine phosphorylation of Syk and its substrates . However , loss of Cbl-b does not enhance the activation of

<div class="entities" style="line-height: 2.5; direction: ltr">

</mark>
 , a selective oral vasopressin V2 receptor antagonist , ameliorates podocyte injury in puromycin aminonucleoside nephrotic rats . BACKGROUND : Proteinuria caused by glomerular disease is characterized by podocyte injury . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P30518

</mark>
 antagonists are effective in reducing albuminuria , although their actions on glomerular podocytes have not been explored . The objective of this study was to evaluate the effects of tolvaptan , a selective oral V2 receptor antagonist , on podocytes in a puromycin aminonucleoside ( PAN ) - induced nephrosis rat model . METHODS : Rats were allocated to a control , PAN nephrosis , or tolvaptan-treated PAN nephrosis group ( n = 9 per group ) . Urinary protein excretion and serum levels of total protein , albumin , creatinine , and total cholesterol were measured on day 10 . The influence of tolvaptan on podocytes was examined in renal tissues by immunofluorescence and electron microscopy . RESULTS : PAN induced massive proteinuria and serum creatinine elevation on day 10 , both of which were significantly ameliorated by tolvaptan . Immunofluorescence studies of the podocyte-associated proteins nephrin and podocin revealed granular staining patterns in PAN nephrosis rats . In tolvaptan-treated rats , nephrin and podocin expressions retained their normal linear pattern . Electron microscopy showed foot process effacement was ameliorated in tolvaptan-treated rats . CONCLUSIONS : 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 is protective against podocyte damage and proteinuria in PAN nephrosis . This study indicates that tolvaptan exerts a renoprotective effect by affecting podocyte morphology and probably function in PAN nephrosis . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is a promising pharmacological tool in the treatment of renal edema .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Prevalence of insomnia and associated factors in South Korea . INTRODUCTION : In Western countries , insomnia is associated with daytime impaired functioning , as well as physical and psychiatric illnesses . However , little information exists on insomnia in Asian countries . This study investigates the prevalence and correlates of insomnia in the general population of South Korea . METHODS : A representative sample of the South Korean general population composed of 3719 noninstitutionalized individuals aged 15 years or older were interviewed by telephone using the Sleep-EVAL system . The participation rate was 91.4 % . The interviews covered sleep habits , sleep symptomatology , physical and psychiatric illnesses . DSM-IV sleep and psychiatric disorder diagnoses were also assessed . RESULTS : Insomnia symptoms occurring at least three nights per week were reported by 17.0 % of the sample ; difficulty initiating sleep ( Q8IX12 ) was mentioned by 4.0 % of the sample , difficulty maintaining sleep ( DMS ) by 11.5 % , early morning awakenings ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15941
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) by 1.8 % , and nonrestorative sleep ( NRS ) by 4.7 % of the sample . DSM-IV insomnia disorder diagnoses were found in 5 % of the sample . Over 50 % of subjects with insomnia symptoms reported important daytime consequences and another 20 % reported mild or moderate consequences . However , the proportion of insomnia subjects seeking medical help for their sleep problems was very low ( 6.8 % ) . CONCLUSIONS : As in Western countries , insomnia is widespread in South Korea , affecting nearly one in five individuals . Many of them would benefit from medical help ; however , few insomnia subjects are consulting for this problem . An educational effort is needed for both the general population and the physicians .</div>

 : its promise in treating non-small-cell lung cancer . The use of chemotherapy in the treatment of early and advanced non-small-cell lung cancer ( NSCLC ) has increased during the past decade . One of the main reasons for the increased acceptance of chemotherapy is the development of several new cytotoxic agents with a unique mechanism ( s ) of action and high single-agent activity , combined with a favorable toxicity profile .

 ( Alimta ) is a novel antifolate that inhibits several enzymes involved in DNA synthesis ( thymidylate synthase [ TS ] , dihydrofolate reductase [

 ] , and glycinamide ribonucleotideformyltransferase [ GARFT ] ) . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ' s toxicity is markedly reduced by folic acid and vitamin B12 supplementation . The compound has been studied extensively in various tumor types , including NSCLC . In NSCLC , pemetrexed at 500 mg / m2 , every 3 weeks , given i . v . over 10 minutes , has shown promising activity , and can safely be administrated with vitamin supplementation . After registration , single-agent pemetrexed will certainly add to the chemotherapeutic options available for pretreated patients and will most likely change significantly chemotherapy prescriptions in second-line chemotherapy . In first-line chemotherapy , the role of platinum-based and - free combination doublet chemotherapy with pemetrexed still needs to be defined . Phase II data indicate high efficacy combined with favorable toxicity for pemetrexed in combination with cisplatin , carboplatin ( DB00958 ) , oxaliplatin ( Eloxatin ) , gemcitabine ( Gemzar ) , and vinorelbine ( Navelbine ) . This review summarizes the clinical experience obtained thus far during the early clinical development of pemetrexed in NSCLC .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Determination of fenofibric acid concentrations by HPLC after anion exchange solid-phase extraction from human serum . Triglycerides are increasingly being recognized as a risk factor for cardiovascular disease . Research efforts to identify sources of variability in triglyceride-lowering response to the lipid-lowering drug fenofibrate require quantification of the active acidic form of this 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 agonist . Anion-exchange solid-phase extraction , in combination with reverse-phase high-performance liquid chromatography ( HPLC ) , rapidly and accurately determines steady-state fenofibric acid serum concentrations . Chromatographic separation under isocratic conditions , with use of ultraviolet detection at 285 nm , provides clean baseline and sharp peaks for clofibric acid , 1 - napthyl acetic acid ( internal standards ) , and fenofibric acid . Commonly prescribed and over-the-counter nonsteroidal anti-inflammatory drugs ( NSAIDs ) were screened for assay interference , and the assay was employed to quantify fenofibric acid in more than 800 human subject specimens . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 analysis was found to be linear over the range of 0.5 to 40 mg / L and was validated with either internal standard . Accuracies ranged from 98.65 % to 102.4 % , whereas the within - and between-day precisions ranged from 1.0 % to 2.2 % and 2.0 % to 6.2 % , respectively . NSAIDs had minimal interference with the assay , which succeeded in quantifying fenofibric acid in more than 843 of 846 serum samples from human subjects , many taking a variety of coadministered medications . Anion-exchange solid-phase extraction in combination with reverse-phase HPLC accurately determines steady-state fenofibric acid serum concentrations in humans without interference from NSAIDs or commonly administered medications . This method is suitable for quantification of fenofibric acid for clinical pharmacokinetic studies in patients with dyslipidemia .</div>
